const addAccount = (data) => {
  return (dispatch) => {
      fetch('http://localhost:3000/api/v1/accounts', {
          headers: {
              'Contet-Type': 'application/json',
              'Accept': 'application/json'
        },
      method: 'POST',
      body: JSON.stringify(data),
    });
  };
};
export default addAccount;
